import React from 'react'

function Container({ image, title, explain, links }) {
  return (
    <div className='flex gap-5 md:w-[450px] border-2 border-dark-grey'>
      <div className='basis-1/2'>
        <img src={image} alt="image"/>
      </div>
      <div className='basis-1/2 flex-col'>
        {title}
        {explain}
        {links}
      </div>
    </div>
  )
}

export default Container
